package practice.neetCode150.part3SlidingWindow.hard;

import java.util.*;

public class minimumWindowSubstring {

    public static void main(String args[]) {

        System.out.println(minWindow("ADOBECODEBANC", "ABC"));
        System.out.println(minWindow("AA", "AA"));
        System.out.println(minWindow("AB", "B"));
        System.out.println(minWindow(
                "",
                ""));

    }

    public static String minWindow(String s, String t) {

        if (t.length() == 0)
            return "";

        HashMap<Character, Integer> map1 = new HashMap<>();

        for (char i : t.toCharArray())
            map1.put(i, map1.getOrDefault(i, 0) + 1);

        HashMap<Character, Integer> map2 = new HashMap<>();
        int l = 0, r = 0;
        int have = 0, need = map1.size();
        int checkpointl = 0, checkpointr = 0;

        int min = Integer.MAX_VALUE;
        while (r < s.length()) {

            Character rc = s.charAt(r);

            map2.put(rc, map2.getOrDefault(rc, 0) + 1);

            if (map1.containsKey(rc) && map1.get(rc).intValue() == map2.get(rc).intValue())
                have++;

            while (have == need) {

                if (min > (r - l + 1)) {
                    min = Math.min(min, (r - l + 1));
                    checkpointl = l;
                    checkpointr = r;
                }

                Character lc = s.charAt(l);

                map2.put(lc, map2.get(lc) - 1);

                if (map1.containsKey(lc) && map2.get(lc).intValue() < map1.get(lc).intValue()) {
                    have -= 1;
                }

                l++;

            }

            r++;

        }

        if (min == Integer.MAX_VALUE)
            return "";
        else
            return new StringBuilder(s.substring(checkpointl, checkpointr + 1)).toString();

    }

}
